import React from 'react';
import { MainContainer, MainBackground, VideoBackground } from './MainElements';
export const MainSection = () => {
    return(
        <MainContainer>
            <MainBackground>
                <VideoBackground muted autoPlay loop src={Video} type='video/mov'/>
            </MainBackground>
        </MainContainer>
    )
}
